import Login from './Compoment/Login';
import React from 'react'
import './asset/css/bootstrap.min.css';
import './App.css'
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
function App() {
  return (
    <Router>
      <Switch>
        <Route exact={true} path="/login" render={() =>  <Login status_login={true}></Login>}></Route>
      </Switch>
    </Router>
  );
}


export default App;
